// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awToolbarRenderFunction } from 'js/AwToolbarService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwToolbarService', () => import('js/AwToolbarService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "initialize": {
            "actionType": "JSFunctionAsync",
            "deps": "js/AwToolbarService",
            "method": "awToolbarInitFunction",
            "inputData": {
                "0": {
                    "firstAnchor": "{{props.firstAnchor}}",
                    "secondAnchor": "{{props.secondAnchor}}"
                }
            },
            "outputData": {
                "firstCommandList": "firstCommandList",
                "secondCommandList": "secondCommandList",
                "trace": "trace"
            }
        },
        "refreshServerVisibility": {
            "actionType": "JSFunctionAsync",
            "deps": "js/AwToolbarService",
            "method": "refreshServerVisibilityToolbar",
            "inputData": {
                "0": {
                    "firstAnchor": "{{props.firstAnchor}}",
                    "secondAnchor": "{{props.secondAnchor}}",
                    "firstCommandList": "{{data.firstCommandList}}",
                    "secondCommandList": "{{data.secondCommandList}}",
                    "visibilityLoader": "{{props.visibilityLoader}}",
                    "trace": "{{data.trace}}"
                }
            },
            "outputData": {
                "visibleServerCommands": ""
            }
        },
        "render": {
            "method": "awToolbarRenderFunction",
            "options": {},
            "deps": "js/AwToolbarService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "onMount": "initialize",
        "onUpdate": {
            "action": "refreshServerVisibility",
            "observers": [
                "props.visibilityLoader",
                "viewModel.data.firstCommandList",
                "viewModel.data.secondCommandList"
            ]
        },
        "render": "render"
    },
    "props": {
        "first-anchor": {
            "type": "string"
        },
        "second-anchor": {
            "type": "string"
        },
        "orientation": {
            "type": "string"
        },
        "reverse": {
            "type": "object"
        },
        "reverse-second": {
            "type": "reverse"
        },
        "show-command-labels": {
            "type": "object"
        },
        "visibility-loader": {
            "type": "object"
        },
        "context": {
            "type": "object"
        },
        "overflow": {
            "type": "string"
        }
    },
    "_viewModelId": "AwToolbar",
    "_uniqueViewModelId": "AwToolbar",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awToolbarRenderFunction, {}, ctxImportObj );

export default Component;
